import React from "react";
import { Link, NavLink } from "react-router-dom";

const links = [
  { to: "/", label: "Home" },
  { to: "/about", label: "About" },
  { to: "/services", label: "Services" },
  { to: "/faq", label: "FAQ" },
  { to: "/blog", label: "Blog" },
  { to: "/contact", label: "Contact" },
];

const NavBar = () => {
  return (
   <nav className="flex justify-between items-center py-4 px-8 bg-white shadow-sm">
  <h1 className="font-serif text-2xl tracking-wide text-gray-900">
    Taylor-Made <span className="text-pink-300">Baby Planning</span>
  </h1>
  <ul className="flex space-x-6 text-gray-700 font-light">
    <li><a href="/" className="hover:text-pink-400">Home</a></li>
    <li><a href="/services" className="hover:text-pink-400">Services</a></li>
    <li><a href="/about" className="hover:text-pink-400">About</a></li>
    <li><a href="/contact" className="hover:text-pink-400">Contact</a></li>
  </ul>
</nav>
  );
};

export default NavBar;
